import React from 'react'
import TextField from '@material-ui/core/TextField'

export const TaskNameInput = ({ data, edit, isTimerWorking, action, click }) => {
    let isAccess = !!work
    let btnClick = click ? 'inputTaskFalse' : 'inputTaskTrue'
    return(
        <div className={btnClick}>
            <form onSubmit={action}>
                <TextField 
                    id="standard-basic" 
                    label="Enter task name"
                    value={data}
                    onChange={edit}
                    disabled={isAccess}
                />
            </form>
        </div>
    )
}
